import React, { useState, useEffect } from 'react';
import './ActualizarAlojamiento.css';

const ActualizarAlojamiento = ({ hotel, onClose, onUpdate }) => {
  const [formValues, setFormValues] = useState({
    name: '',
    latitud: '',
    longitud: '',
    price: '',
    description: '',
    bedrooms: '',
    bathrooms: '',
    estado: 'Disponible',
  });

  useEffect(() => {
    if (hotel) {
      setFormValues({
        name: hotel.name,
        latitud: hotel.latitud,
        longitud: hotel.longitud,
        price: hotel.price,
        description: hotel.description,
        bedrooms: hotel.bedrooms,
        bathrooms: hotel.bathrooms,
        estado: hotel.estado,
      });
    }
  }, [hotel]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await fetch(`http://localhost:3001/alojamiento/putAlojamiento/${hotel.id}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          Titulo: formValues.name,
          Descripción: formValues.description,
          Latitud: parseFloat(formValues.latitud),
          Longitud: parseFloat(formValues.longitud),
          PrecioPorDia: parseFloat(formValues.price),
          CantidadDormitorios: parseInt(formValues.bedrooms),
          CantidadBanios: parseInt(formValues.bathrooms),
          Estado: formValues.estado,
        }),
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.message || response.statusText);
      }

      onUpdate(hotel.id, {
        ...hotel,
        ...formValues,
      });
      onClose();
    } catch (error) {
      console.error('Error updating hotel:', error);
    }
  };

  return (
    <div className="modal">
      <div className="modal-content">
        <span className="close" onClick={onClose}>&times;</span>
        <form onSubmit={handleSubmit}>
          <label>
            Nombre:
            <input type="text" name="name" value={formValues.name} onChange={handleChange} />
          </label>
          <label>
            Latitud:
            <input type="text" name="latitud" value={formValues.latitud} onChange={handleChange} />
          </label>
          <label>
            Longitud:
            <input type="text" name="longitud" value={formValues.longitud} onChange={handleChange} />
          </label>
          <label>
            Precio:
            <input type="text" name="price" value={formValues.price} onChange={handleChange} />
          </label>
          <label>
            Descripción:
            <textarea name="description" value={formValues.description} onChange={handleChange}></textarea>
          </label>
          <label>
            Dormitorios:
            <input type="text" name="bedrooms" value={formValues.bedrooms} onChange={handleChange} />
          </label>
          <label>
            Baños:
            <input type="text" name="bathrooms" value={formValues.bathrooms} onChange={handleChange} />
          </label>
          <label>
            Estado:
            <select name="estado" value={formValues.estado} onChange={handleChange}>
              <option value="Disponible">Disponible</option>
              <option value="Reservado">Reservado</option>
            </select>
          </label>
          <button type="submit">Actualizar</button>
        </form>
      </div>
    </div>
  );
};

export default ActualizarAlojamiento;
